import React, { Component } from "react";
import './App.css';
import Button from 'react-bootstrap/Button'
import Navbar from 'react-bootstrap/Navbar'
import Container from 'react-bootstrap/Container'
import Nav from 'react-bootstrap/Nav'
import 'bootstrap/dist/css/bootstrap.min.css'
import { render } from 'react-dom';
import Moment from 'react-moment';
import 'moment-timezone';

class Home extends Component{
    state ={users:[],date_create: Moment().format("DD-MM-YYYY hh:mm:ss") }

    componentDidMount() {
      fetch('/api/1')
      .then(res => res.json())
      .then(users => this.setState({ users}));
    }



render(){
  return (

    <div className="App">

     <Navbar bg="primary" variant="dark">
    <Container>
    <Navbar.Brand href="#home">Sample App</Navbar.Brand>
    <Nav className="me-auto">
      <Nav.Link href="#home">MyLinkedIn</Nav.Link>
      <Nav.Link href="#features">My GitHub</Nav.Link>
      <Nav.Link href="#pricing">Project Repo</Nav.Link>
    </Nav>
    </Container>
  </Navbar>

  <Container>
    <h1>Current Time - {date_create}</h1>
    <br />
    {this.state.users.map(user => <li key={user.StopId}>
           {user.Route} {user.hours}
           </li>)}

  </Container>
    </div>
  );
}
}
export default Home;
